/*
Public domain NASA elevation data for Nepal.

https://en.wikipedia.org/wiki/Shuttle_Radar_Topography_Mission
 */

BEGIN;
CREATE TABLE "elevation"."nasa_srtm1" ("rid" serial PRIMARY KEY,"rast" raster,"filename" text);
INSERT INTO "elevation"."nasa_srtm1" ("rast","filename") VALUES (ST_Transform(''::raster, 4326),'clipped_raster.tiff');
CREATE INDEX ON "elevation"."nasa_srtm1" USING gist (st_convexhull("rast"));
ANALYZE "elevation"."nasa_srtm1";
SELECT AddRasterConstraints('elevation','nasa_srtm1','rast',TRUE,TRUE,TRUE,TRUE,TRUE,TRUE,FALSE,TRUE,TRUE,TRUE,TRUE,TRUE);
END;
VACUUM ANALYZE "elevation"."nasa_srtm1";
